SET DEFINE OFF
/
ALTER TABLE NARRATIVE DISABLE CONSTRAINT FK_NARRATIVE_TYPE_CODE_KRA
/
ALTER TABLE VALID_NARR_FORMS DISABLE CONSTRAINT FK_VALID_NARR_FORMS
/
TRUNCATE TABLE NARRATIVE_TYPE
/
TRUNCATE TABLE VALID_NARR_FORMS
/

commit;
SELECT SEQ_VALID_NARR_FORMS_ID.NEXTVAL,v.FORM_NAME,v.NARRATIVE_TYPE_CODE,v.MANDATORY,v.UPDATE_TIMESTAMP,v.UPDATE_USER,SYS_GUID(),1 
FROM OSP$VALID_NARR_FORMS@coeus.kuali v LEFT OUTER JOIN VALID_NARR_FORMS vf ON v.FORM_NAME=vf.FORM_NAME AND v.NARRATIVE_TYPE_CODE=vf.NARRATIVE_TYPE_CODE
WHERE vf.FORM_NAME IS NULL
/
SELECT n.NARRATIVE_TYPE_CODE,n.DESCRIPTION,n.SYSTEM_GENERATED,n.ALLOW_MULTIPLE,n.NARRATIVE_TYPE_GROUP,n.UPDATE_TIMESTAMP,n.UPDATE_USER,1,SYS_GUID() 
FROM OSP$NARRATIVE_TYPE@coeus.kuali n LEFT OUTER JOIN NARRATIVE_TYPE nt ON n.NARRATIVE_TYPE_CODE=nt.NARRATIVE_TYPE_CODE 
WHERE nt.NARRATIVE_TYPE_CODE IS NULL
/
DELETE FROM VALID_NARR_FORMS WHERE NARRATIVE_TYPE_CODE IN(
SELECT NARRATIVE_TYPE_CODE FROM VALID_NARR_FORMS WHERE NARRATIVE_TYPE_CODE NOT IN(SELECT NARRATIVE_TYPE_CODE FROM NARRATIVE_TYPE))
/
ALTER TABLE NARRATIVE ENABLE CONSTRAINT FK_NARRATIVE_TYPE_CODE_KRA
/
ALTER TABLE VALID_NARR_FORMS ENABLE CONSTRAINT FK_VALID_NARR_FORMS
/
commit
/
